async (t) => {
  const destPath = await charlike(
    '@aaa/zzzzzzz',
    'quxie hoohy bar desc, that was easy!!!',
    {
      cwd: './node_modules',
      // templates: '~/.jsproject',
      locals: {
        nspId: 'e6fdasdasd4e30caaab',
      },
    },
  );

  t.strictEqual(typeof destPath, 'string');
  t.strictEqual(destPath.endsWith('node_modules/zzzzzzz'), true);
}
